column4:
@realDonaldTrump @DailyCaller @Jim_Jordan @RepMattGaetz @MarkMeadows @FoxNews @USATODAY @RepDevinNunes @dcexaminer @RepGosar @RepRalphNorman @CongressmanHice @RepJeffDuncan @RepScottPerry @RepAndyHarrisMD @RichardGrenell But even more than uncovering the evidence, we need accountability and we need criminal prosecutions. What happened to President Trump &amp; those around him should NEVER again happen to ANY American.

We need one standard of justice.

And we need to hold everyone to that standard.

@realDonaldTrump Thankfully, these corrupt officials failed.

But their failure did not prevent them from taking the next step of their coup against America's duly elected president.

Many of these officials tried to overthrow President Trump, culminating in the Mueller witch-hunt/Ukraine hoax.

Draconian, life-altering policies have been - and continue to be - executed because of these unreliable bureaucratic stats.

Extremely frustrating.

@AlexBerenson @kerpen @aginnt https://t.co/H2s4pCbo8Q

@realDonaldTrump I support a peaceful transfer of American power - it's one of the hallmarks of our constitutional republic. 

I call on Democrats to support a peaceful transfer of power - both past and future. 

Our future depends on it.

